import React, { Component } from "react";
import Navbar from "../Navbar/Navbar";
import Sidebar from "../Sidebar/Sidebar";
import "./HomePage.css";

export default class HomePage extends Component {
  render() {

    return (
      <div>

        <Navbar citiesInfo={this.props.citiesInfo} filteredCities={this.props.filteredCities} />

        <div className="citiesContainer">
          {this.props.citiesInfo.map((cityImage) => {
            return (<img className="cityImage" src={cityImage.CityimageSrc} alt=""/>  );
          })}

        </div>
      </div>
    );
  }
}
